import * as React from 'react';
import {ImageCardList} from '../../components/ChooseImage';
import {Summary} from '../../components/Summary';


interface IPage{
    dpage: string;
}


function PageDisplay(props : IPage)  {

    // const nav = props;

    if(props.dpage=="1"){
    return(
        <ImageCardList/>
    );
    }else if(props.dpage=="2"){
    return(
        <h1>HI</h1>
    );
    }else if(props.dpage=="3"){
    return(
        <h1>HI</h1>
    );
    }else if(props.dpage=="4"){
    return(
        <h1>HI</h1>
    );
    }else if(props.dpage=="5"){
    return(
        <Summary/>
    );

    }

    return null;

};

export default PageDisplay;

